
CREATE DATABASE marketing_campaign
GO

USE marketing_campaign
GO


SET NAMES utf8mb4;
SET FOREIGN_KEY_CHECKS = 0;

-- ----------------------------
-- Table structure for campaigns
-- ----------------------------
CREATE TABLE campaigns (
    id INT NOT NULL IDENTITY(1,1), -- AUTO_INCREMENT in MySQL becomes IDENTITY in SQL Server
    user_id INT NULL,
    name VARCHAR(50) NULL,
    process_date DATE NULL,
    process_hour TIME(0) NULL, -- time in MySQL, default precision is 0 in SQL Server
    total_records INT NULL,
    total_sent INT DEFAULT 0,
    total_error INT DEFAULT 0,
    process_status INT NULL,
    final_hour TIME(0) NULL,
    PRIMARY KEY (id),
    FOREIGN KEY (user_id) REFERENCES users (id) -- Corrected: Added parenthesis for the referenced column.
);
GO
-- ----------------------------
-- Records of campaigns
-- ----------------------------


-- ----------------------------
-- Table structure for customers
-- ----------------------------
CREATE TABLE customers (
    id INT NOT NULL IDENTITY(1,1),
    name VARCHAR(250) NULL,
    deleted TINYINT DEFAULT 0,
    PRIMARY KEY (id)
);
GO

-- ----------------------------
-- Records of customers
-- ----------------------------

-- ----------------------------
-- Table structure for messages
-- ----------------------------
CREATE TABLE messages (
    id INT NOT NULL IDENTITY(1,1),
    campaign_id INT NULL,
    phone VARCHAR(10) NULL, --  Character set and collation are handled differently in SQL Server.
    text VARCHAR(160) NULL,
    shipping_status TINYINT DEFAULT 1,
    shipping_hour TIME(0) NULL,
    PRIMARY KEY (id),
    FOREIGN KEY (campaign_id) REFERENCES campaigns (id)
);
GO

-- ----------------------------
-- Records of messages
-- ----------------------------

-- ----------------------------
-- Table structure for users
-- ----------------------------
CREATE TABLE users (
    id INT NOT NULL IDENTITY(1,1),
    customer_id INT NULL,
    username VARCHAR(50) NULL,
    deleted TINYINT DEFAULT 0,
    PRIMARY KEY (id),
    FOREIGN KEY (customer_id) REFERENCES customers (id)
);
GO

-- ----------------------------
-- Records of users
-- ----------------------------

SET FOREIGN_KEY_CHECKS = 1;
